import React from "react";

const SocialIcons = () => {
  return (
    <div className="social-icons">
      <a href="#">
        <img src="https://upload.wikimedia.org/.../Instagram_icon.png" />
      </a>  
      <a href="#">
        <i className="fa fa-linkedin-square fa-3x text-primary"></i>
      </a>
      <a href="#">
        <i className="fa fa-whatsapp fa-3x text-success"></i>  
      </a>       
      <a href="#">
        <i className="fa fa-facebook-official fa-3x text-primary"></i>         
      </a>        
      <a href="#">
        <i className="fa fa-github fa-3x"></i>      
      </a>        
    </div>  
  );
};

export default SocialIcons;
